import React from 'react';
import HomePage from './Pages/Homepage/homepage';
import { Route } from 'react-router-dom';
import './App.css';

const FunnyPage = () => {
  return (
    <div>
      <h1>Funny Page</h1>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <Route exact path='/' component={HomePage} />
      <Route exact path='/funny' component={FunnyPage} />
    </div>
  );
}

export default App;
